after:
region      = "eu-west-1"
environment = "dev"

tags = {
  team        = "supplychain"
  application = "supplychain-wms-pogo-mock"
}

rds_config = {
  instance_config = {
    identifier              = "supplychain-wms-pogo-mock"
    engine                  = "postgres"
    engine_version          = "15.2"
    family                  = "postgres15"
    instance_class          = "db.t4g.small"
    storage_type            = "gp3"
    allocated_storage       = "20"
    max_allocated_storage   = 0
    multi_az                = false
    backup_retention_period = 1
  }
  database_config = {
    name        = "main"
    master_user = "masteruser"
    db_users    = ["admin"]
    port        = "5432"
  }
}
